import React from "react";
import { Fragment } from "react";

import Card from "./components/card";

class Knowledge extends React.Component {
  render() {
    return (
      <Fragment>
        <Card />
        <Card />
        <Card />
        <Card />
        <Card />
      </Fragment>
    );
  }
}
export default Knowledge;
